import React, {useState, useEffect} from "react";
import {connect} from "react-redux"
import Header from "../headers/header"
import wave1 from "../../assets/images/wave1.svg"
import wave2 from "../../assets/images/wave2.svg"
import Link from '@material-ui/core/Link'

import Typography from '@material-ui/core/Typography';
import Breadcrumbs from '@material-ui/core/Breadcrumbs';
import TextField from '@material-ui/core/TextField';
import { withStyles, makeStyles } from "@material-ui/styles";
import { Button } from '@material-ui/core';



const Profile = (props) => {

    const InputTextWhite = withStyles({
        root: {
          '& label.Mui-focused': {
            color: 'green',
          },
          '& .MuiInput-underline:before': {
            borderBottomColor: 'white',
          },
          '& .MuiInput-underline:hover:before': {
            borderBottomColor: 'white',
          },
          '& .MuiInput-underline:after': {
            borderBottomColor: 'white',
            color:"white"
          },
        },
      })(TextField);

    const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        color: "#fff"
    },
    margin: {
        margin: theme.spacing(1),
    },
    }));

    const classes = useStyles();


    return(
        <div className="root">
            <Header />
            <div className="header-pages">

                <div className="header-pages-content">
                    <h2>Profil</h2>
                    <Breadcrumbs>
                        <Link to="/" className="link">Accueil</Link>
                        <Typography color="secondary">Profil</Typography>
                    </Breadcrumbs>
                </div>

                <div className="wave-categories-home">
                    <object type="image/svg+xml" data={wave1} className="wave-header-pages"/>
                    <object type="image/svg+xml" data={wave2} className="wave-header-pages"/>
                </div>

            </div>

            <div className="profile-container">

                <div className="profile-content-container default-background-gradient">
                    <h3>Mes informations</h3>
                    <div className="profile-contact">

                        <form autoComplete="off">
                                    <InputTextWhite
                                        className={classes.margin}
                                        label="Nom"
                                        required
                                        InputLabelProps={{style : {color : "#B4B4B4"}}}
                                        InputProps={{style : {color : "#fff"}}}
                                    />
                        </form>
                    </div>
                </div>
            </div>
        </div>
    )
}

const mapStateToProps = (store) =>{
    return {
        user : store.user
    }    
}

const mapDispatchToProps = {

}

export default connect(mapStateToProps, mapDispatchToProps)(Profile)
